ControlPropertyState.AutoRuleBindingString:
// Calcula o último índice do lote offline
Set(varUltimoIndiceLote, 
    If(
        CountRows(colDadosOffline) > 0,
        Max(colDadosOffline, IndiceLote),
        0
    )
);

// Para cada número de 1 a 20, cria um registro de teste único e sequencial
With(
    {
        novoRegistro: Patch(
            Form2.Updates, Form2.Updates,
            {
                IndiceLote: varUltimoIndiceLote + 1,
                StatusSync: "PENDENTE",
                MensagemSync: "",
                DataCriacao: Date(Year(Now()), Month(Now()), Day(Now()))
            }
        )
    },
    // Verifica duplicidade e adiciona ao offline, ou marca como duplicado
    If(
        IsBlank(LookUp(colComparacaoLista, id_notificacao = novoRegistro.id_notificacao)) && 
        IsBlank(LookUp(colDadosOffline, id_notificacao = novoRegistro.id_notificacao)),
            Collect(colDadosOffline, novoRegistro);
            Collect(colComparacaoLista, {id_notificacao: novoRegistro.id_notificacao});
            Collect(colDadosLista, novoRegistro), // Aqui é somente para o usuário identificar que o item foi lançado, porém ele ainda está armazenado somente no cache do dispositivo
        If(
            !IsBlank(LookUp(colComparacaoLista, id_notificacao = novoRegistro.id_notificacao)) && 
            IsBlank(LookUp(colDadosOffline, id_notificacao = novoRegistro.id_notificacao)),
            Patch(colDadosOffline, Defaults(colDadosOffline), novoRegistro, {IndiceLote: varUltimoIndiceLote + 1, StatusSync: "PENDENTE", MensagemSync: ""});
            UpdateIf(colDadosLista,  id_notificacao = novoRegistro.id_notificacao, novoRegistro)
            ,
            Patch(colDadosOffline,LookUp(colDadosOffline, id_notificacao = novoRegistro.id_notificacao), novoRegistro, { StatusSync: "PENDENTE", MensagemSync: ""});
            UpdateIf(colDadosLista, id_notificacao = novoRegistro.id_notificacao, novoRegistro)
        )
    )
);

// Salva as collections modificadas
SaveData(colDadosOffline, "CacheDadosOffline");
SaveData(colComparacaoLista, "CacheListaComparacao");

// Limpa e reseta o formulário e o ComboBox
ResetForm(Form2);

// Se estiver online, já sincroniza automaticamente
If(
    Connection.Connected,
        //Select(btn_sinc);;
        Notify("Registros de teste salvos e sincronizados automaticamente!", NotificationType.Success)
    ,
        Notify("Registros de teste salvos localmente! Sincronize depois para enviar ao SharePoint.", NotificationType.Information)
);

Navigate(LookUp(colTelas, NomeTela = "Home Screen").Tela);
